def encrypt(m):
    try:
        assert len(m)<=126
        m = bytes_to_long(m)
        return long_to_bytes(pow(m, 2, n))
    except:
        return None

def decrypt(c):
    try:
        c = bytes_to_long(c)
        mp = pow(c, (p + 1)//4, p)
        mq = pow(c, (q + 1)//4, q)
        ms = []
        for mp in [mp,p-mp]:
            for mq in [mq,q-mq]:
                m = long_to_bytes((mp*inverse(q,p)*q + mq*inverse(p,q)*p) % n)
                if len(m)<=126:
                    ms.append(m)
        assert len(ms)==1
        return ms[0]
    except:
        return None

def getmyPrime(nbits):
    p = getPrime(nbits)
    while(p%4==1):
        p = getPrime(nbits)
    return p

